import React,{useEffect} from "react";
import {connect} from 'react-redux';
import * as actions from '../actions/pos';
import Sales from "./Sales";
import Sales_master from "./sales_master";
import './SalesParent.css'
import Sales_preview from "./Sales_preview";

function Salesparent(props) {


    useEffect(() => {
        props.fetchAllPos();
    }, []);

    return (<div>
        {props.poslist.map((record, index) => {
            return (<ul key={index}>
                <li>{record.Password}</li>
                <li>{record.UserID}</li>
                <li>{record.UserLogin_DateTime}</li>
                <li>{record.UserName}</li>
                <li>{record.UserType}</li>
            </ul>);
        })}
        <div className="rowC" ><Sales  /><Sales_master/> <Sales_preview/></div>

    </div>);

}
actions.TableString.StringOfTable="UserLogin";
const mapStateToProps = state=>({
        poslist: state.pos.list  
})

const mapActionToProps =  {
    fetchAllPos: actions.fetchall
}

export default connect(mapStateToProps,mapActionToProps)(Salesparent);
